
CREATE TABLE `admin_hierarchy` (
  `node_id` varchar(255) NOT NULL,
  `code` varchar(3) DEFAULT NULL,
  `country` varchar(255) DEFAULT NULL,
  `zone_code` varchar(20) DEFAULT NULL,
  `zone` varchar(255) DEFAULT NULL,
  `region` varchar(255) DEFAULT NULL,
  `region_code` varchar(20) DEFAULT NULL,
  `district_code` varchar(20) DEFAULT NULL,
  `district` varchar(255) DEFAULT NULL,
  `council_code` varchar(20) DEFAULT NULL,
  `council` varchar(255) DEFAULT NULL,
  `ward_code` varchar(100) DEFAULT NULL,
  `ward` varchar(255) DEFAULT NULL,
  `village_mtaa_code` varchar(100) DEFAULT NULL,
  `village_mtaa` varchar(255) DEFAULT NULL,
  `population` int(11) DEFAULT NULL,
  `status` int(11) NOT NULL DEFAULT 0
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


ALTER TABLE `admin_hierarchy`
  ADD PRIMARY KEY (`node_id`);